import dash_bootstrap_components as dbc
import dash_core_components as dcc
from dash_html_components import *
from textwrap import dedent

sub = lambda letter, number: [Em(f"{letter}"), Sub(f"{number}")]
E1 = sub('E', 1)
E2 = sub('E', 2)
E12 = sub('E', "1,2")
X1 = sub("X", 1)
X2 = sub("X", 2)
x1 = sub("x", 1)
x2 = sub("x", 2)


def layout(*args, **kwargs):
    return dbc.Col(width={'size': 8, 'offset': 2}, className='text-justify', children=[
        H1("Documentation", className='display-4 text-center my-5'),

        H2("Screen Design"),
        P(["Information on screen design, cell lines, compounds and quality control can be downloaded here: ", Br(),
                A("Download Screen Information", href="/downloads/screen_information_20190211.pdf", target="_blank", rel="noopener noreferrer"),
                " (PDF, 614kB)."]),
        H2("Single agent & combination response"),
        P("Single agent responses are normalised to controls and fitted. Single agent maximum effect (MaxE) is derived from the fit of the single agent response at the highest screened concentration (fitted for individual replicates if available)."),
        P("Measured inhibition of the combination wells is also normalised to controls. The combination maximum effect (combo_MaxE) corresponds to the second highest measured data point. There is currently no combination surface fit available in MatrixExplorer v1."),

        H2("Synergy reference models"),
        H4("Highest Single Agent (HSA)"),
        P(["According to the HSA model, a combination of Drug 1 and Drug 2 is classified as synergistic if the effect of the combination (", *E12, ") is larger than the effect of either Drug 1 (", *E1, " or Drug 2 (", *E2, ") alone (whichever is larger)."]),
        P([Em("Synergy: "), Em("E", className="pl-5"), Sub("1,2"), " > max(", *E1, ",", *E2, ")"]),
        P("Whilst the HSA model can simply and effectively identify combinations with a better effect than either of the single agents, it fails to distinguish between responses that are less than or greater than the additive response expected by combining the two drugs. Hence, the HSA model does not distinguish between additive and synergistic effects."),
        P(["HSA excess is calculated by subtracting the highest effect of either single agent from the combination response (", *E12, "), whereby a positive HSA excess indicates synergy."]),
        P([Em("HSA excess: "), Em("E", className="pl-5"), Sub("1,2"), " - max(", *E1, ",", *E2, ")"]),

        H4("Bliss independence"),
        P("Bliss independence is one of the most widely used synergy metrics. The null model assumes that the drug effects of two drugs are mechanistically, and therefore also probabilistically, independent. Additionally, Bliss scores assume the single agents have exponential dose effect curves."),
        P(["To calculate a Bliss excess, the single agent activities of Drug 1 (", *E1, ") and Drug 2 (", *E2, "), as well as the observed effect of the combination (", *E12, "), must be expressed as a probability between 0 and 1 (0 ≤ ", *E1, " ≤ 1, 0 ≤ ", *E2, " ≤ 1, and 0 ≤ ", *E12, " ≤ 1, respectively)."]),
        P([Em("Additive Bliss effect: "), Em("E", className="pl-5"), Sub("1"), " + ", *E2, "(1-", *E1, ") =", *E1, " + ", *E2, " - ", *E1, *E2]),
        P("Bliss excess is currently calculated as the difference between the measured inhibition of the combination and the Bliss additivity of the monotherapies at the same concentrations."),
        P([Em("Bliss excess: "), Em("E", className="pl-5"), Sub("1,2"), " - (", *E1, " + ", *E2, " - ", *E1, *E2, ")"]),

        H4("Loewe additivity"),
        P(["Loewe additivity focusses on the concentrations necessary to produce a given effect, rather than the effects at given concentrations. To fulfil Loewe additivity, the combination effect ", *E12, " at doses ", *X1, " and ", *X2, " has to produce the same inhibitory effect than the single agent doses at ", *x1, " and ", *x2, "."]),
        P([Em("Loewe index: "), Span("(", className='pl-5'), *x1, " / ", *X1, ") + (", *x2, " / ", *X2, ")"]),
        P("with an index = 1 indicating Loewe additivity, an index > 1 an effect greater than Loewe additivity and an index < 1 an effect smaller than Loewe additivity."),
        P(["Loewe additivity assumes a constant potency ratio between the two drugs and that there is dose equivalence. This leads to the same combination principle that an equivalent dose of drug 1 (", *x1,") can be substituted for drug 2 (", *x2, ") to produce the same combined effect of ", *E12, "."]),
        P("A fitted model of the combination interaction surface is currently not available. Hence, no reliable Loewe index can be calculated."),
        dcc.Markdown(dedent("""
            
            
            
            
            
            #### References
            
            Foucquier and Guedj, &quot;Analysis of drug combinations: current methodological landscape&quot;, Pharmacology Research and Perspectives, 2015.
            
            Lehar et al., &quot;Chemical combination effects predict connectivity in biological systems&quot;, Molecular Systems Biology, 2007.
            
            Bliss, &quot;The toxicity of poisons applied jointly&quot;, Annals of Applied Biology, 1939.
            
            ## **Full matrix vs. 3x3 window**
            
            Synergy metrics can be calculated across the entire combination dose matrix (i.e. across all the 49 wells), or across a smaller 3x3 sub-matrix (a &quot;window&quot;). The window is used to uncover dose ranges where highest synergy is seen and thereby describes localised synergy effects.
            
            Reported are the windows with highest mean synergy across all 3x3 wells or across all synergistic wells within a 3x3 window. For this, mean synergy is calculated for all possible 3x3 windows in a matrix and the highest window is reported.
            
            3x3 window:                         _sum of 9 wells / 9 wells_
            
            3x3 window, synergy only:                _sum of synergistic wells in window / # of synergistic wells in window_
            
             ![](data:image/*;base64,)
            
            To locate the window in a matrix two locators are available describing the upper right corner of the window, whereby dose1 describes the dose of drug 1 (horizontal) and dose2 describes the dose of drug 2 (vertical). Doses are reported on a scale from D1 to D7, with D1 being the highest screened concentration.
            
            ## **Glossary of terminology**
            
            The full glossary can be downloaded here [Download button &quot;Glossary of available metrics&quot;].
            
            #### Screen-related metrics
            
            | **Metric name** | **Explanation** |
            | --- | --- |
            | BARCODE | Barcode of the assay plate |
            | DRUGSET\_ID | ID of the drug set used for the assay plate(Drug set describes the individual plate layout &amp; drug composition) |
            | cmatrix | Identifier for a combination matrix within a drug set |
            | well\_treatments | Combination of drug set library tags |
            
            #### Cell line-related metrics
            
            | **Metric name** | **Explanation** |
            | --- | --- |
            | CL | Cell line identifier used in the curve fit |
            | CELL\_LINE\_NAME | Name of the cell line |
            | MASTER\_CELL\_ID | Sanger database master ID |
            | COSMIC\_ID | COSMIC database identifier |
            | SIDM | Sanger ID Model (Cell Model Passports identifier) |
            | TISSUE | Sanger tissue classification |
            | CANCER\_TYPE | Sanger cancer type classification |
            
            #### Library drug-related metrics
            
            The two drugs used in the matrices are called &quot;lib1&quot; and &quot;lib2&quot;, with lib1 being the first drug listed in the combination. All metrics below are available for both drugs.
            
            | **Metric name** | **Explanation** |
            | --- | --- |
            | lib1 | Drug set library tag identifier |
            | lib1\_ID | Sanger database identifier of drug |
            | lib1\_name | Drug name |
            | lib1\_conc | Highest screened concentration (in μM) |
            | lib1\_RMSE | RMSE: root mean square errorDescribes how far the data points are from the single agent curve fit |
            | lib1\_MaxE | Fitted inhibition value at the highest used concentration |
            | lib1\_IC50\_ln | Natural log of IC50 |
            | lib1\_IC50\_uM | IC50 in μM |
            | lib1\_target | Protein target(s) |
            | lib1\_pathway | Pathway of protein target(s) |
            | lib1\_owner | Sanger database drug owner |
            
            #### Combination response-related metrics
            
            | **Metric name** | **Explanation** |
            | --- | --- |
            | matrix\_size | Number of wells treated with the combination e.g. 49 for a 7x7 matrix |
            | combo\_MaxE | Maximum inhibitory effect of the combination within the matrixBased on the 2nd highest data point in the matrix |
            | Delta\_MaxE\_lib1 | _combo\_MaxE - lib1\_MaxE_ |
            | Delta\_MaxE\_lib2 | _combo\_MaxE - lib2\_MaxE_ |
            | Delta\_combo\_MaxE\_day1 | _combo\_MaxE - day1\_inhibi__tion\_scale_ |
            
            #### Synergy-related metrics
            
            All metrics below have been derived for two synergy reference models: Bliss excess and HSA excess. The used placeholder &quot;X&quot; thereby stands either for &quot;Bliss&quot; or for &quot;HSA&quot;.
            
            | **Metric name** | **Explanation** |
            | --- | --- |
            | X\_synergistic\_wells | Number of wells with a response in excess of that expected by the synergy reference model |
            | X\_matrix | Mean excess effect over X across the matrixCalculated by _sum all wells_ / _number of wells_ |
            | X\_matrix\_SO | Mean excess effect over X across the matrix (synergistic wells only)Calculated by _sum synergistic wells_ / _number of synergistic wells_ |
            | X\_window\_size | Local sub-matrix size in one dimension e.g. &quot;3&quot; = 3x3 matrix |
            | X\_window | Mean excess effect over X across the windowCalculated by _sum all wells_ / _number of wells_ |
            | X\_window\_dose1 | Locator of upper right corner of window (library 1)D1-D7 with D1 being the highest screened concentration |
            | X\_window\_dose2 | Locator of upper right corner of window (library 2)D1-D7 with D1 being the highest screened concentration |
            | X\_window\_SO\_size | Local synergy only sub-matrix size in one dimension e.g. &quot;3&quot; = 3x3 matrix |
            | X\_window\_SO | Mean excess effect over X across the window (synergistic wells only)Calculated by _sum synergistic wells_ / _number of synergistic wells_ |
            | X\_window\_SO\_dose1 | Locator of upper right corner of synergy only window (library 1)D1-D7 with D1 being the highest screened concentration |
            | X\_window\_SO\_dose2 | Locator of upper right corner of synergy only window (library 2)D1-D7 with D1 being the highest screened concentration |
            
            #### Day1-related metrics
            
            | **Metric name** | **Explanation** |
            | --- | --- |
            | day1\_intensity\_mean | Mean observed luminescent intensity of Day1 plate |
            | day1\_intensity\_sd | Standard deviation of observed luminescent intensities across Day1 plate |
            | day1\_viability\_mean | Mean viability of Day1 plate, scale: 0-1 with 1 = full viabilityCalculated with respect to Day4 controls |
            | day1\_viability\_sd | Standard deviation of Day1 plate viabilities |
            | day1\_inhibition\_scale | Mean viability of Day1 plate converted to inhibition scale, scale: 0-1 with 1 = full inhibition_1 - day1\_viability\_mean_ |
            | growth\_rate | _log __2__ ((NC) / day1\_intensity\_mean)_Where NC is the mean intensity of negative controls for the Day4 plate |
            | doubling\_time | Doublingtime in hours_72\* log __2__ (2) / (log __2__ (NC) - log __2__ (day1\_intensity\_mean))_ |"""
                            ))
    ])

